// Shell Recharge's error message JSON is farked
// But the HTTP node sometimes reports a simple string
if (msg.payload.includes("{")) {
    // it's JSON
    msg.error = msg.payload.substring(msg.payload.indexOf('{'),msg.payload.lastIndexOf('}')+1);
} else {
    // it's plaintext
    msg.error = '{"message":"' + msg.payload + '"}';
};
return msg;

